(2, 2, 1, '2017-05-19 07:55:05', 'Excellent Park with plenty of grass for the kids to run around on, as well as a massive playground. Events are held here regularly so may have difficulty finding a carpark. But all in all 5 Star park', 5),
(1, 1, 1, '2017-05-19 05:57:29', 'Huge playground! Kids space has always been my son\'s favorite park. We don\'t bother going on weekends because there are not enough car parks for the amount of families that come here, the toilets are pretty rancid. You are bound to find shards of broken glass so make sure your children don\'t take off their shoes. I havnt seen a water bubbler with a tray at the bottom for dogs so bring your own water bowl for your pup. More shaded seating is needed.', 3),
(3, 3, 1, '2017-05-19 08:35:19', 'Don\'t Rate it.', 1),
(4, 1, 1, '2017-05-20 15:29:29', 'This is definitely a park of some sort.', 3),
